    for idx in range(len(optlist)):
        print(f'[main] {idx}-th opt', flush=True)
        print(f"{optlist[idx]}", flush=True)

        # ---- 每次读取都重新做一次约束处理 ----
        opt_dict = {}
        for opt in optlist[idx].split():
            if "-fno-" in opt:
                opt_dict[opt.replace("-fno-", "-f", 1)] = False
            else:
                opt_dict[opt] = True

        c = ConstrainsSolver(constrains_file="constrains/doris.txt")
        c.solve(opt_config=opt_dict)
        
        processed_opt = " ".join(
            sorted([
                opt if opt_dict[opt] else get_opt_negation(opt)
                for opt in opt_dict
            ])
        )
        
        print(processed_opt, flush=True)
        passed = manager.build(opt_config=' -g ' + processed_opt)
        if passed == 0:
            continue

        
        o = processed_opt.split(' ')

        o = reduceFlags(o, manager=manager)
        o = reduceMore(o, manager=manager)

        result = ' '.join(o)
        if "success" not in result:
            result = result.replace('-O3', '').replace('-O2', '').replace('-O1', '').replace('-O0', '').strip()
            with open("constrains/doris.txt", "a") as fc:
                fc.write(result + '\n')
                fc.flush()
                os.fsync(fc.fileno()) 
        f.write(' '.join(o) + '\n')
        f.flush()

    f.close()
